import React,{Component} from 'react';
import 'tachyons';
import './Nav.scss';
import  {ReactComponent as LogoDebugged} from './debuggedlogo.svg';

const Nav =({onRouteChange,route})=>
{
    return (
      <div>
      <div className="topnav">
      <div className="mt0">

      </div>
       &nbsp;
       <ol className="navhead">
           <li  className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')}>Home</li>
           <li  className={`nav left ul f4`}><a href="#about" className="white">About Us</a></li>
           <li  className={`nav ul f4 ${route==='work'?'active1':'left ul'} mr2.5`} onClick={()=>onRouteChange('work')}>Our work</li>
           <li  className={`nav ul f4 ${route==='contact'?'active1':'left ul'}`} onClick={()=>onRouteChange('contact')}>Contact us</li>
       </ol>
     </div>
     </div>

    );
  }

export default Nav;
 // <LogoDebugged/>
